from numpy import einsum
from numpy.typing import NDArray
from chem.hf.ghf_data import GHF_Data
from chem.ccsd.ghf_ccsd import GHF_CCSD_Data


def get_cc_j_doubles_doubles(
    ghf_data: GHF_Data,
    ghf_ccsd_data: GHF_CCSD_Data,
) -> NDArray:
    """ tensor_subscripts: ('a', 'b', 'i', 'j', 'c', 'd', 'k', 'l') """
    f = ghf_data.f
    g = ghf_data.g
    kd =  ghf_data.identity_singles
    v = ghf_data.v
    o = ghf_data.o
    t1 = ghf_ccsd_data.t1
    t2 = ghf_ccsd_data.t2
    
    contracted_intermediate = -1.00 * einsum('ac,bd,ik,lj->abijcdkl', kd[v, v], kd[v, v], kd[o, o], f[o, o], optimize=['einsum_path', (0, 1, 2, 3)])
    cc_j_doubles_doubles =  1.00000 * contracted_intermediate + -1.00000 * einsum('abijcdkl->abijcdlk', contracted_intermediate)  + -1.00000 * einsum('abijcdkl->baijcdkl', contracted_intermediate)  +  1.00000 * einsum('abijcdkl->baijcdlk', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('ac,bd,jk,li->abijcdkl', kd[v, v], kd[v, v], kd[o, o], f[o, o], optimize=['einsum_path', (0, 1, 2, 3)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abijcdkl->abijcdlk', contracted_intermediate)  + -1.00000 * einsum('abijcdkl->baijcdkl', contracted_intermediate)  +  1.00000 * einsum('abijcdkl->baijcdlk', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('bd,ik,jl,ac->abijcdkl', kd[v, v], kd[o, o], kd[o, o], f[v, v], optimize=['einsum_path', (0, 1, 2, 3)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abijcdkl->abjicdkl', contracted_intermediate)  + -1.00000 * einsum('abijcdkl->abijdckl', contracted_intermediate)  +  1.00000 * einsum('abijcdkl->abjidckl', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('ad,ik,jl,bc->abijcdkl', kd[v, v], kd[o, o], kd[o, o], f[v, v], optimize=['einsum_path', (0, 1, 2, 3)])
