    contracted_intermediate =  1.00 * einsum('ad,ik,jl,mc,bm->abijcdkl', kd[v, v], kd[o, o], kd[o, o], f[o, v], t1, optimize=['einsum_path', (0, 1), (1, 2), (0, 2), (0, 1)])
